import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import ConstantMenu from './components/ConstantMenu/constantMenu.jsx';
import ProfilePage from './components/ProfilePage/profile.jsx';
import FilmCatalogPage from './components/FilmCatalogPage/filmCatalogPage.jsx';
import BookCatalogPage from './components/BookCatalogPage/bookCatalogPage.jsx';
import ChosenBook from './components/ChosenBook/chosenBook.jsx';

const App = (props) => {
  return (
    <Router>
      <div className="App">
        <ConstantMenu />
        <div className="app-wrapper-content">
          <Routes>
            <Route path='/profile' element={<ProfilePage />}/>
            <Route path='/filmCatalog' element={<FilmCatalogPage />}/>
            <Route path='/bookCatalog' element={<BookCatalogPage/>}/>
            <Route path='/bookCatalog/*' element={<ChosenBook author="Kinugasa" genre="Lightnovel" aboutBook="Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam a pulvinar elit. Sed eget dui dolor. Pellentesque facilisis lacus eget tortor fermentum viverra. Vestibulum placerat ligula non ligula eleifend tincidunt. Vivamus molestie massa sed arcu viverra posuere. Proin nec efficitur risus. Vivamus faucibus lacinia mauris sed efficitur. Donec a suscipit dui, at tristique mi. Donec eu tortor quis justo feugiat maximus in eu tellus. Aenean quis libero eget diam fermentum porta at id lacus. Donec a ipsum id dolor rutrum laoreet. Vivamus nisl nisl, sollicitudin in nisi ut, hendrerit accumsan diam. Maecenas non magna maximus, vulputate arcu nec, placerat ipsum."/>}/>
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
